package ru.javaprojects.leetcode_tasks.is_subsequence;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class SolutionTest {

    @Test
    void isSubsequenceWhenSubSequence() {
        Solution solution = new Solution();
        assertTrue(solution.isSubsequence("abc", "ahbgdc"));
        assertTrue(solution.isSubsequence("", "ahbgdc"));
        assertTrue(solution.isSubsequence("ab", "baab"));
        assertTrue(solution.isSubsequence("leeeeetcode", ""));
    }

    @Test
    void isSubsequenceWhenNotSubSequence() {
        Solution solution = new Solution();
        assertFalse(solution.isSubsequence("axc", "ahbgdc"));
        assertFalse(solution.isSubsequence("aaaaaa", "bbaaaa"));
    }
}